import * as React from "react";
import { Head } from "next/head";
const Photography = (props) => {
  return (
    <div className="photography">
      <div className="row">
        <div className="col">
          <h1>Photography</h1>
          <blockquote>An Art that freeze the time forever </blockquote>
        </div>
        <div className="col">
          <p>Photography is the tool that allows me to view the world with very different angle.
            Before start doing photography I see a things and don't care about that beauty, color, shape, etc.
          </p>
          <p>
            I always belive that, a single photo can change entire world from nuclear disaster field to garden.
            I occasionally upload the photo on the my Instagram account. I always want to become a street photographer, but I never take a good street photo till date.
          </p>
        </div>
      </div>
    </div>
  );
};
export default Photography;
